import React from "react";
import Header from './Header';
const Assistant = () => {
    return (
        <div className="ax-w-7xl mx-auto">
            <Header />
            <div className=" pt-16 bg-gray-200">
                <div className="text-center ">
                    <h1 className="text-2xl">Улучшение знания начинается здесь с ассистентами СДУ</h1>
                    <p>Мы вам предлагаем самых профессиональных ассистентов для хорошей успеваемости</p>
                </div>
            </div>
        </div>
    );
}


export default Assistant;
